const makeRandomArray = (initialArr) => {
    let arr = [...initialArr];
    return [...arr].map(() => {
        const index = Math.floor(Math.random() * arr.length);
        const item = arr[index]
        arr = arr.filter((n) => n !== item);
        return item;
    })
}

